import React from "react";
import styles from "./Headercss.module.css";
import CoffeeIcon from "@mui/material/Coffee";
// import {ReactComponent as Marca} from './images/coffe.svg';
export { Co } from '@mui/material/SvgIcon';

const Header = () => {
  return (
    <>
      <div className={styles.dp_flex}>
        <div className={styles.logo}>
          <img src={CoffeeIcon} classname={styles.imagem} alt="/" />
          <h1>teste</h1>
        </div>
        <a className={styles.borda} href="/">
          Home
        </a>
        <a className={styles.borda} href="/">
          Produtos
        </a>
        <a className={styles.borda} href="/">
          Sobre
        </a>
      </div>
    </>
  );
};

export default Header;
